import React, { Component } from "react";
import Home from "./components/home";
import Header from "./components/common/header";
import GodzillaDisplay from "./components/godzilla/godzillaListPage";
import MechagodzillaDisplay from "./components/mechagodzilla/mechagodzillaListPage";
import GhidorahDisplay from "./components/ghidorah/ghidorahListPage";
import GodzillaPath from "./components/godzilla/godzillaPathname";
import MechagodzillaPath from "./components/mechagodzilla/mechagodzillaListPage";
import GhidorahPath from "./components/ghidorah/ghidorahListPage";
import Footer from "./components/common/footer";
import { Route, Switch, Router } from "react-router-dom";

class App extends Component {
  render() {
    return (
      <>
        <Header />
        <Router>
          <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/godzilla-list" component={GodzillaDisplay} />
            <Route
              path="/mechagodzilla-list"
              component={MechagodzillaDisplay}
            />
            <Route path="/ghidorah-list" component={GhidorahDisplay} />
          </Switch>
        </Router>
        <Footer />
      </>
    );
  }
}

export default App;
